import React, { useEffect } from 'react';
import "./Project.css"
import {
  Navigate
} from "react-router-dom";

import {useParams} from "react-router-dom";
import {projects} from "../../data/projects.js"
import {gitResource} from "../../requests/gitResource.js";

export function Project() {

  useEffect(() => { //cant be called after the return as react hooks are tempermental
    document.title = `${projectClass} | Elliot Buckingham`;
  });

  const { projectClass } = useParams();
  let projectID = 0;
  if(!projects.reduce((x, y) => { 
    x || y.name === projectClass;
    if(!x) { projectID++; } 
  }, false)){
    return <Navigate to={"/not-found"}/>
  }
  const project = projects[projectID];
  return(
    <div id="content">
      <h2>{projectClass}</h2>
      <p>{gitResource(project.url)}</p>
    </div>
  )
}
